import React, { Component } from 'react';

export default class Badge2 extends Component {

    render() {
        return (
            <div className="badges2">
                <div>
                    <blockquote class="badgr-badge"><a href="https://api.badgr.io/public/assertions/DdT1JSu5S8-3hSNh2Z4-1g?v=1_1"><img src="https://api.badgr.io/public/badges/LPJax9V7QKu4Cqxfez_oZg/image?type=png"></img></a><p class="badgr-badge-name">CSS framework - level 2</p><script async="async" src="https://badgr.io/widgets.bundle.js"></script></blockquote>
                </div>
                <div>

                </div>
                <div>

                </div>
            </div>
        );
    }
}
